import Profile from './components/Profile';

const App = () => {
  return (
    <div className='app-wrapper'>
      const Header = () => {
  <header className='header'>
    <img src="https://cdn.logo.com/hotlink-ok/logo-social.png"/>
  </header>
}
      <Navbar/>
      <Profile/>
    </div>
  );
}

export default App;
